import HeaderPage from './HeaderPage';
const Model3 = () => {
    return ( 
        <div>
      <HeaderPage
         title="Model 3"
         background={modelsback}
         description="Plaid"
         range="390mi"
         time="1.99s"
         speed="200mph"
         horsepower="1,020hp"
         first
      />
      <div className="models_container">
      </div>
      </div> 
    );
}
 
export default Model3;
